import { createBrowserRouter, RouterProvider } from 'react-router-dom';
import Home from './views/Home.js';

const myRouter = createBrowserRouter([{ path: '/', element: <Home /> }]);

function App() {
  return <RouterProvider router={myRouter} />;
}

export default App;
